import React from "react";

type Props = {
  title: string;
  content: string[];
  name: string;
  organizer: string;
  date: string;
  venue: string;
};

export const Template = (props: Props) => {
  const data: any = {
    title: "Bengkel Photoshop",
    name: "Bengkel PhotoShop",
    organizer: "JTMK",
    date: "22/4/2022",
    venue: "MEPD 2",
    content: [
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Quod consequuntur eveniet facilis quo perspiciatis earum est repellat aliquid culpa quis. Blanditiis, quis quos et rerum id voluptas. Ipsum, iure omnis repellendus atque in recusandae facere ullam labore assumenda dicta error, fuga, aliquid commodi fugit earum nobis quisquam unde architecto voluptatem odio! Iure, dolore? Corrupti eaque eligendi unde vitae blanditiis, consequuntur dicta explicabo, voluptatem debitis quibusdam voluptates quo id repellendus alias illo doloremque ab repudiandae assumenda pariatur esse sunt. Itaque ut, facere nisi exercitationem consequuntur quisquam, voluptas veniam a, numquam aperiam ipsam modi enim ipsa minus unde sint labore adipisci id?",
      "Lorem ipsum dolor sit amet consectetur adipisicing elit. Quod consequuntur eveniet facilis quo perspiciatis earum est repellat aliquid culpa quis. Blanditiis, quis quos et rerum id voluptas. Ipsum, iure omnis repellendus atque in recusandae facere ullam labore assumenda dicta error, fuga, aliquid commodi fugit earum nobis quisquam unde architecto voluptatem odio! Iure, dolore? Corrupti eaque eligendi unde vitae blanditiis, consequuntur dicta explicabo, voluptatem debitis quibusdam voluptates quo id repellendus alias illo doloremque ab repudiandae assumenda pariatur esse sunt. Itaque ut, facere nisi exercitationem consequuntur quisquam, voluptas veniam a, numquam aperiam ipsam modi enim ipsa minus unde sint labore adipisci id?",
    ],

    signature: '/assets/signature.png'
  };

  return data.map((item: any) => {
    return (
      <div className="my-2.5 w-[500px] h-[600px] font-serif m-auto bg-white rounded-sm p-10 flex flex-col text-[10px]">
        <img
          src="/assets/logoPoli.png"
          alt="psmza"
          className="w-[150px] mx-auto"
        />

        <div className="mt-5">
          <section className="uppercase font-bold text-center">
            <h1>LAPORAN {item.title}</h1>
            <h1>JABATAN TEKNOLOGI MAKLUMAT DAN KOMUNIKASI</h1>
            <h1>POLITEKNIK SULTAN MIZAN ZAINAL ABIDIN, DUNGUN TERENGGANU</h1>
          </section>

          <section className="mt-10">
            <h1 className="font-bold ">BUTIRAN PROGRAM</h1>
            <ol className=" list-[lower-alpha] ml-5 list-outside">
              <li className="my-2">Nama Program: {item.name}</li>
              <li className="my-2">Penganjur: {item.organizer}</li>
              <li className="my-2">Tarikh: {item.date}</li>
              <li className="my-2">Tempat: {item.venue}</li>
            </ol>
          </section>

          <section className="mt-10">
            <h1 className="font-bold">PENGISIAN/PERLAKSANAAN PROGRAM</h1>
            {item.content.map((item: any) => {
              return(
                <p className=" indent-8 mt-5 text-justify">{item}</p>
              )
            })}
          </section>

          <section className="mt-10">
            <p>Disediakan oleh: </p>
            <div className=" border-b-2 border-dotted border-black w-[80px] mt-2 h-[30px]">
              <img
                src={item.signature}
                alt="signature"
                className="object-cover h-[30px] mx-auto"
              />
            </div>
            <section className="text-[8px]">
              <p>(MUHAMMAD ZULASRAF BIN ZULKIFLI)</p>
              <p>(PENGARAH)</p>
            </section>
          </section>
        </div>
      </div>
    );
  });
};
